INSERT INTO components VALUES('r84nmhzefx5u','wn89oo6bhd2b','simple login page with github oauth',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { Input } from ''@/components/ui/input'';\nimport { Github } from ''lucide-vue-next'';\n</script>\n\n<template>\n  <div class="w-full min-h-screen bg-gray-100 dark:bg-black flex items-center justify-center p-4">\n    <div class="w-full max-w-md bg-white dark:bg-gray-900 rounded-lg shadow-md p-8 space-y-6">\n      <h1 class="text-2xl font-bold text-center text-gray-900 dark:text-gray-100">\n        Log In\n      </h1>\n      <div class="space-y-4">\n        <Input\n          type="email"\n          placeholder="Enter your email"\n          class="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-blue-500"\n        />\n        <Input\n          type="password"\n          placeholder="Enter your password"\n          class="w-full px-4 py-2 border rounded-md focus:ring-2 focus:ring-blue-500"\n        />\n      </div>\n      <Button class="w-full bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-600">\n        Log In\n      </Button>\n      <div class="flex items-center justify-between">\n        <hr class="w-full bg-gray-300" />\n        <span class="p-2 text-gray-500 dark:text-gray-400">\n          OR\n        </span>\n        <hr class="w-full bg-gray-300" />\n      </div>\n      <Button class="w-full bg-gray-800 text-white py-2 px-4 rounded-md hover:bg-gray-900 flex items-center justify-center">\n        <Github class="h-5 w-5 mr-3" />\n        Sign in with GitHub\n      </Button>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1703954837488,'{"description":{"user":"simple login page with github oauth","llm":"Create a simple login page component that includes a form with an input field for email, a password field, and a login button. Additionally, incorporate a ''Sign in with GitHub'' button to enable OAuth authentication with GitHub. The design should be clean and user-friendly, prioritizing ease of use and accessibility."},"components":[{"name":"card","usage":"to structure the login form and OAuth button ensuring a clean and organized layout"},{"name":"input","usage":"to create the email and password fields where users can enter their credentials"},{"name":"button","usage":"to create the ''Log In'' and ''Sign in with GitHub'' buttons"},{"name":"avatar","usage":"optional, to show a GitHub icon within the ''Sign in with GitHub'' button for visual clarity"},{"name":"alert","usage":"to display any login errors or validation messages to the user"}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('ema2a5up8wu2','wn89oo6bhd2b','make it looks like a default "Clerk" SignIn component',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { Input } from ''@/components/ui/input'';\nimport { Github } from ''lucide-vue-next'';\n</script>\n\n<template>\n  <div class="w-full min-h-screen flex items-center justify-center p-4 dark:bg-black">\n    <div class="w-full max-w-md rounded-lg shadow-md bg-white p-8 dark:bg-gray-900 space-y-6">\n      <h1 class="text-2xl font-bold text-center text-gray-900 dark:text-white">\n        Sign in to your account\n      </h1>\n      <div class="space-y-4">\n        <Input type="email" placeholder="Email address" class="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 dark:bg-black dark:border-gray-700 dark:text-white" />\n        <Input type="password" placeholder="Password" class="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 dark:bg-black dark:border-gray-700 dark:text-white" />\n      </div>\n      <Button class="w-full bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 dark:hover:bg-blue-700">\n        Sign in\n      </Button>\n      <div class="flex items-center justify-between">\n        <hr class="w-full bg-gray-300 dark:bg-gray-700" />\n        <span class="p-2 text-gray-500 dark:text-gray-400">\n          or\n        </span>\n        <hr class="w-full bg-gray-300 dark:bg-gray-700"/>\n      </div>\n      <Button class="w-full bg-gray-800 text-white py-2 px-4 rounded-md hover:bg-gray-900 flex items-center justify-center focus:outline-none focus:ring-2 focus:ring-gray-800 dark:hover:bg-gray-700">\n        <Github class="h-5 w-5 mr-3" />\n        Sign in with GitHub\n      </Button>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1703954990784,'{"description":{"user":"make it looks like a default \"Clerk\" SignIn component","llm":"simple login page with GitHub OAuth"},"components":[{"name":"card","usage":"Provides a structured layout for the sign-in form, resembling a default Clerk SignIn component."},{"name":"input","usage":"To capture the user''s GitHub username or email."},{"name":"button","usage":"To submit the form and initiate the OAuth process."},{"name":"alert","usage":"To provide user feedback on the login process, such as errors or confirmation messages."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('fxntm4rqng95','rtwx08pa2axt','A job search engine that lets you search jobs with your resume',replace('\n<script setup lang="ts">\nimport { ref } from ''vue''\nimport { Input } from ''@/components/ui/input''\nimport { Label } from ''@/components/ui/label''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\nimport { Table, TableBody, TableCell, TableRow } from ''@/components/ui/table''\nimport { Pagination, PaginationList, PaginationListItem, PaginationPrev, PaginationNext } from ''@/components/ui/pagination''\nimport { Skeleton } from ''@/components/ui/skeleton''\n</script>\n\n<template>\n  <div class="dark:bg-black">\n    <div class="p-4 mx-auto max-w-7xl">\n      <h1 class="text-xl font-bold dark:text-white">Job Search Engine</h1>\n      <div class="my-4 space-y-4 md:flex md:items-center md:space-y-0 md:space-x-4">\n        <div class="flex-grow">\n          <Label for="resume-upload" class="block mb-1 dark:text-gray-200">Upload Resume</Label>\n          <Input id="resume-upload" type="file" class="w-full" />\n        </div>\n        <div>\n          <Label for="job-title" class="block mb-1 dark:text-gray-200">Job Title</Label>\n          <Input id="job-title" type="text" placeholder="e.g. Software Engineer" class="w-full"/>\n        </div>\n        <div>\n          <Label for="location" class="block mb-1 dark:text-gray-200">Location</Label>\n          <Input id="location" type="text" placeholder="City or Zip code" class="w-full"/>\n        </div>\n        <div>\n          <Label for="experience-level" class="block mb-1 dark:text-gray-200">Experience Level</Label>\n          <Input id="experience-level" type="text" placeholder="e.g. Entry Level" class="w-full"/>\n        </div>\n        <Button class="flex items-center px-4 py-2 mt-4 text-white bg-blue-600 rounded-md md:mt-0 hover:bg-blue-700">\n          <span>Search Jobs</span><ArrowRight class="w-4 h-4 ml-2"/>\n        </Button>\n      </div>\n    </div>\n    \n    <div class="p-4 mx-auto max-w-7xl">\n      <!-- Skeleton loaders as placeholders for loading state -->\n      <div v-if="false" class="grid grid-cols-1 gap-4 md:grid-cols-2">\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n      </div>\n      \n      <!-- Search results placeholder table -->\n      <Table>\n        <TableBody>\n          <TableRow v-for="index in 5" :key="index">\n            <TableCell class="dark:text-gray-300">Company Name</TableCell>\n            <TableCell class="dark:text-gray-300">Job Title</TableCell>\n            <TableCell class="dark:text-gray-300">Location</TableCell>\n            <TableCell class="dark:text-gray-300">Posted Date</TableCell>\n            <TableCell class="dark:text-gray-300">Apply Now</TableCell>\n          </TableRow>\n        </TableBody>\n      </Table>\n      \n      <!-- Pagination component as placeholder -->\n      <Pagination class="flex justify-center my-4">\n        <PaginationList>\n          <PaginationPrev>\n            <Button variant="outline" disabled>\n              Previous\n            </Button>\n          </PaginationPrev>\n          <PaginationListItem as-child value="1">\n            <Button variant="outline" class="w-10 h-10 p-0">1</Button>\n          </PaginationListItem>\n          <PaginationListItem as-child value="2">\n            <Button variant="outline" class="w-10 h-10 p-0">2</Button>\n          </PaginationListItem>\n          <PaginationNext>\n            <Button variant="outline">\n              Next\n            </Button>\n          </PaginationNext>\n        </PaginationList>\n      </Pagination>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1703997957603,'{"description":{"user":"A job search engine that lets you search jobs with your resume","llm":"Design a Vue component for a job search engine that allows users to search for jobs using their resume. The component should include an input field or area where users can upload their resume, along with other optional filters such as job title, location, and experience level. Moreover, a section to display the search results and provide the ability to sort or filter through the listed jobs would be necessary. Incorporating visual indicators for loading states and handling empty or error states to improve user experience is also important."},"components":[{"name":"input","usage":"To allow users to upload their resume."},{"name":"card","usage":"To display each job listing as a separate card."},{"name":"button","usage":"To include a search button to initiate the job search."},{"name":"checkbox","usage":"To provide optional filters such as full-time, part-time, remote options, etc."},{"name":"select","usage":"To allow users to select additional filters like job category or experience level."},{"name":"table","usage":"To display search results in a tabular and organized manner."},{"name":"pagination","usage":"To navigate through pages of search results."},{"name":"skeleton","usage":"To show placeholders while the job data is loading."},{"name":"alert","usage":"To display any error or information messages to the users."},{"name":"tooltip","usage":"To provide additional information for certain elements, like filter options."},{"name":"progress","usage":"To show a loading state when a search is in progress."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('vdmm5w6raukm','rtwx08pa2axt','Make the "previous" and "next" button to have proper width, and change the upload resume button to be using "default" variant',replace('\n<script setup lang="ts">\nimport { ref } from ''vue''\nimport { Input } from ''@/components/ui/input''\nimport { Label } from ''@/components/ui/label''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\nimport { Table, TableBody, TableCell, TableRow } from ''@/components/ui/table''\nimport { Pagination, PaginationList, PaginationListItem, PaginationPrev, PaginationNext } from ''@/components/ui/pagination''\nimport { Skeleton } from ''@/components/ui/skeleton''\n</script>\n\n<template>\n  <div class="dark:bg-black">\n    <div class="p-4 mx-auto max-w-7xl">\n      <h1 class="text-xl font-bold dark:text-white">Job Search Engine</h1>\n      <div class="my-4 space-y-4 md:flex md:items-center md:space-y-0 md:space-x-4">\n        <div class="flex-grow">\n          <Label for="resume-upload" class="block mb-1 dark:text-gray-200">Upload Resume</Label>\n          <Button variant="default" as-child>\n            <label for="resume-upload" class="w-full">\n              <Input id="resume-upload" type="file" class="hidden" />\n              <span class="block w-full px-4 py-2 text-left border border-gray-300 rounded-md cursor-pointer hover:border-gray-400 focus:outline-none focus:ring focus:border-blue-300">\n                Choose a resume to upload\n              </span>\n            </label>\n          </Button>\n        </div>\n        <div>\n          <Label for="job-title" class="block mb-1 dark:text-gray-200">Job Title</Label>\n          <Input id="job-title" type="text" placeholder="e.g. Software Engineer" class="w-full"/>\n        </div>\n        <div>\n          <Label for="location" class="block mb-1 dark:text-gray-200">Location</Label>\n          <Input id="location" type="text" placeholder="City or Zip code" class="w-full"/>\n        </div>\n        <div>\n          <Label for="experience-level" class="block mb-1 dark:text-gray-200">Experience Level</Label>\n          <Input id="experience-level" type="text" placeholder="e.g. Entry Level" class="w-full"/>\n        </div>\n        <Button class="flex items-center px-4 py-2 mt-4 text-white bg-blue-600 rounded-md md:mt-0 hover:bg-blue-700">\n          <span>Search Jobs</span><ArrowRight class="w-4 h-4 ml-2"/>\n        </Button>\n      </div>\n    </div>\n    \n    <div class="p-4 mx-auto max-w-7xl">\n      <!-- Skeleton loaders as placeholders for loading state -->\n      <div v-if="false" class="grid grid-cols-1 gap-4 md:grid-cols-2">\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n        <Skeleton class="h-12 w-full rounded" />\n      </div>\n      \n      <!-- Search results placeholder table -->\n      <Table>\n        <TableBody>\n          <TableRow v-for="index in 5" :key="index">\n            <TableCell class="dark:text-gray-300">Company Name</TableCell>\n            <TableCell class="dark:text-gray-300">Job Title</TableCell>\n            <TableCell class="dark:text-gray-300">Location</TableCell>\n            <TableCell class="dark:text-gray-300">Posted Date</TableCell>\n            <TableCell class="dark:text-gray-300">Apply Now</TableCell>\n          </TableRow>\n        </TableBody>\n      </Table>\n      \n      <!-- Pagination component as placeholder -->\n      <Pagination class="flex justify-center my-4">\n        <PaginationList>\n          <PaginationPrev as-child>\n            <Button variant="outline" class="px-4 py-2" disabled>\n              Previous\n            </Button>\n          </PaginationPrev>\n          <PaginationListItem as-child value="1">\n            <Button variant="outline" class="w-10 h-10 p-0">1</Button>\n          </PaginationListItem>\n          <PaginationListItem as-child value="2">\n            <Button variant="outline" class="w-10 h-10 p-0">2</Button>\n          </PaginationListItem>\n          <PaginationNext as-child>\n            <Button variant="outline" class="px-4 py-2">\n              Next\n            </Button>\n          </PaginationNext>\n        </PaginationList>\n      </Pagination>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704009750576,'{"description":{"user":"Make the \"previous\" and \"next\" button to have proper width, and change the upload resume button to be using \"default\" variant","llm":"Update the job search engine component to include well-sized ''previous'' and ''next'' buttons, and change the ''upload resume'' button style to a ''default'' variant."},"components":[{"name":"button","usage":"To ensure uniformly sized ''previous'' and ''next'' navigation buttons."},{"name":"button","usage":"To apply the ''default'' variant style to the ''upload resume'' button."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('mxwe2z23qozd','o83zru4xzhby','simple welcome card',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle, CardDescription } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex flex-col items-center justify-center h-screen dark:bg-black">\n    <Card class="w-full max-w-sm bg-white shadow-lg rounded-md dark:text-white dark:border dark:border-gray-700">\n      <CardHeader class="border-b border-gray-100 p-4 dark:border-gray-700">\n        <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n        <CardDescription class="text-sm">Thank you for visiting our web app!</CardDescription>\n      </CardHeader>\n      <CardContent class="p-4">\n        <p class="mb-4">We''re excited to have you on board. Browse around and let us know if you have any questions!</p>\n        <Button variant="primary" class="w-full">\n          Get Started\n          <ArrowRight class="w-4 h-4 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704090945535,'{"description":{"user":"simple welcome card","llm":"A welcome card that greets users when they visit the web app. It should be visually appealing, provide a brief introductory message, and have an option for users to proceed further into the app."},"components":[{"name":"card","usage":"Provides a structured layout for holding the welcome message and any additional content."},{"name":"button","usage":"Offers an interactive element for users to acknowledge the welcome message and navigate further into the app."},{"name":"avatar","usage":"Personalizes the welcome card by displaying the user''s profile picture if available."},{"name":"typography","usage":"To ensure the welcome message and any additional text are presented in a readable and aesthetically pleasing manner."},{"name":"aspect-ratio","usage":"Maintains the desired aspect ratio for any images or visual content within the card."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('c3ps8op53dmv','o83zru4xzhby','change the button to "default" variant, and make it a link to "/onboarding" route',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle, CardDescription } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\n</script>\n\n<template>\n  <div class="flex flex-col items-center justify-center h-screen bg-white dark:bg-black">\n    <Card class="w-full max-w-sm shadow-lg rounded-md border dark:border-gray-700">\n      <CardHeader class="border-b border-gray-100 p-4 dark:border-gray-700">\n        <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n        <CardDescription class="text-sm">Thank you for visiting our web app!</CardDescription>\n      </CardHeader>\n      <CardContent class="p-4">\n        <p class="mb-4">We''re excited to have you on board. Browse around and let us know if you have any questions!</p>\n        <Button as-child variant="default" class="w-full">\n          <router-link to="/onboarding" class="inline-flex items-center justify-center w-full px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-indigo-600 hover:bg-indigo-700">\n            Get Started\n          </router-link>\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704100755513,'{"description":{"user":"change the button to \"default\" variant, and make it a link to \"/onboarding\" route","llm":"simple welcome card"},"components":[{"name":"card","usage":"To provide a structured and aesthetic container for the welcome message and action."},{"name":"button","usage":"To provide a clear call-to-action for navigation to the ''/onboarding'' route. The button should be styled with the ''default'' variant."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('rlr2fxhcy5ln','o83zru4xzhby','let''s place this design on the right, and left section would show a beutiful screenshot of the product',replace('\n<script setup lang="ts">\nimport { AspectRatio } from ''@/components/ui/aspect-ratio''\nimport { Card, CardContent, CardHeader, CardTitle, CardDescription } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ChevronRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex items-center justify-center h-screen bg-white dark:bg-black">\n    <div class="flex w-full max-w-4xl mx-auto">\n      <!-- Left side with product screenshot -->\n      <div class="w-1/2">\n        <AspectRatio :ratio="16 / 9" class="bg-muted shadow-lg rounded-md overflow-hidden">\n          <img\n            src="https://via.placeholder.com/800x450"\n            alt="Product Screenshot"\n            class="object-cover w-full h-full"\n          >\n        </AspectRatio>\n      </div>\n      <!-- Right side with welcome message and link -->\n      <div class="w-1/2 pl-8">\n        <Card class="shadow-lg rounded-md border dark:border-gray-700">\n          <CardHeader class="border-b border-gray-100 p-4 dark:border-gray-700">\n            <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n            <CardDescription class="text-sm">Thank you for visiting our web app!</CardDescription>\n          </CardHeader>\n          <CardContent class="p-4">\n            <p class="mb-4">We''re excited to have you on board. Browse around and let us know if you have any questions!</p>\n            <Button as-child variant="default" class="w-full">\n              <router-link to="/onboarding" class="inline-flex items-center justify-center w-full px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-black bg-white hover:bg-gray-100 dark:text-white dark:bg-gray-800 dark:hover:bg-gray-700">\n                Get Started\n                <ChevronRight class="w-4 h-4 ml-2" />\n              </router-link>\n            </Button>\n          </CardContent>\n        </Card>\n      </div>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704101176023,'{"description":{"user":"let''s place this design on the right, and left section would show a beutiful screenshot of the product","llm":"The Vue component should be updated as follows: On the right side of the component, redesign the button to have a \"default\" variant and to serve as a link to the \"/onboarding\" route. On the left side, display a beautiful screenshot of the product. Ensure consistency in the layout so both sides are balanced and visually appealing."},"components":[{"name":"button","usage":"To implement a default variant button that acts as a link."},{"name":"aspect-ratio","usage":"To maintain a consistent aspect ratio for the screenshot of the product."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('xlgtxaektr6s','l8pxbia43ui5','Create a landing page with a single photo darkened in the background, text in the center, and a rounded navigation bar at the top.',replace('\n<script setup lang="ts">\nimport { NavigationMenu, NavigationMenuList, NavigationMenuItem, NavigationMenuLink } from ''@/components/ui/navigation-menu''\nimport { Home, User, Search } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="relative h-screen w-full">\n    <!-- Background Image with Darkening Overlay -->\n    <div class="absolute inset-0 bg-cover bg-center bg-no-repeat" style="background-image: url(''https://source.unsplash.com/random'')">\n      <div class="absolute inset-0 bg-black bg-opacity-50 dark:bg-opacity-70"></div>\n    </div>\n\n    <!-- Centrally Positioned Text -->\n    <div class="absolute inset-0 flex items-center justify-center">\n      <h1 class="text-5xl font-bold text-white">Welcome to Our Page</h1>\n    </div>\n\n    <!-- Rounded Navigation Bar -->\n    <NavigationMenu as="header" class="absolute top-0 left-0 right-0 bg-white dark:bg-gray-900 p-4 rounded-b-xl shadow-md">\n      <NavigationMenuList class="flex justify-between items-center">\n        <NavigationMenuItem>\n          <NavigationMenuLink as-child>\n            <a href="#" class="flex items-center space-x-2 text-gray-700 dark:text-gray-300 hover:text-gray-900 dark:hover:text-white">\n              <Home class="h-6 w-6"/>\n              <span>Home</span>\n            </a>\n          </NavigationMenuLink>\n        </NavigationMenuItem>\n\n        <NavigationMenuItem>\n          <NavigationMenuLink as-child>\n            <a href="#" class="flex items-center space-x-2 text-gray-700 dark:text-gray-300 hover:text-gray-900 dark:hover:text-white">\n              <Search class="h-6 w-6"/>\n              <span>Search</span>\n            </a>\n          </NavigationMenuLink>\n        </NavigationMenuItem>\n\n        <NavigationMenuItem>\n          <NavigationMenuLink as-child>\n            <a href="#" class="flex items-center space-x-2 text-gray-700 dark:text-gray-300 hover:text-gray-900 dark:hover:text-white">\n              <User class="h-6 w-6"/>\n              <span>Profile</span>\n            </a>\n          </NavigationMenuLink>\n        </NavigationMenuItem>\n      </NavigationMenuList>\n    </NavigationMenu>\n  </div>\n</template>\n','\n',char(10)),1704101319623,'{"description":{"user":"Create a landing page with a single photo darkened in the background, text in the center, and a rounded navigation bar at the top.","llm":"Create a Vue component for a landing page that features a full-width background image with a darkening overlay, centrally positioned text, and a rounded navigation bar at the top of the page."},"components":[{"name":"navigation-menu","usage":"To implement the rounded navigation bar at the top."},{"name":"aspect-ratio","usage":"To maintain the aspect ratio of the background image."},{"name":"card","usage":"To present the central text with optional styling and layout, potentially within a translucent or otherwise styled card to enhance readability against the darkened photo background."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('e0z7yrqiljsm','g8kpfrrng7dd',' I need a one page site where you can drag your excel sheets into it. It needs to look pretty, and the design has to be kind of addicting, with fun animations with the buttons and such. Please make the colors orange and black and use rounded corners. ',replace('\n<script setup lang="ts">\nimport { ref } from ''vue'';\nimport { DocumentAdd, UploadCloud } from ''lucide-vue-next'';\nimport { Button } from ''@/components/ui/button'';\n\nconst handleDragOver = (event) => {\n  event.preventDefault();\n};\n\nconst handleDrop = (event) => {\n  event.preventDefault();\n  // Logic to handle file drop\n};\n\nconst openFileDialog = () => {\n  const fileInput = document.getElementById(''fileInput'');\n  fileInput?.click();\n};\n</script>\n\n<template>\n  <div\n    class="flex h-screen w-full flex-col items-center justify-center bg-orange-100 dark:bg-black p-4"\n    @dragover="handleDragOver"\n    @drop="handleDrop"\n  >\n    <UploadCloud class="mb-4 h-16 w-16 text-orange-500 animate-bounce" />\n    <div class="mb-4 text-center text-xl font-semibold text-orange-700 dark:text-white">\n      Drag and drop your Excel sheets here\n    </div>\n    <Button\n      class="mb-4 flex items-center rounded-full bg-orange-500 px-6 py-3 text-white hover:bg-orange-600 focus:outline-none"\n      @click="openFileDialog"\n    >\n      <DocumentAdd class="mr-2 h-5 w-5"/>\n      <span>Upload Files</span>\n    </Button>\n    <input\n      type="file"\n      id="fileInput"\n      class="hidden"\n      accept=".xlsx, .xls"\n      multiple\n    />\n    <div class="rounded-xl bg-white p-6 shadow-md dark:bg-gray-800">\n      <p class="text-gray-700 dark:text-gray-200">\n        Or select the files from your computer\n      </p>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704101394008,'{"description":{"user":" I need a one page site where you can drag your excel sheets into it. It needs to look pretty, and the design has to be kind of addicting, with fun animations with the buttons and such. Please make the colors orange and black and use rounded corners. ","llm":"Design a Vue component for a one-page site that allows users to drag and drop their Excel sheets into the application. The component should have an appealing and ''addicting'' design, featuring fun animations, primarily using orange and black colors, and incorporating rounded corners for a modern look."},"components":[{"name":"dropzone","usage":"To create an interactive area where users can drag and drop Excel sheets."},{"name":"button","usage":"To provide styled buttons with animations for submitting or cancelling the file upload."},{"name":"toast","usage":"To offer feedback through temporary, non-disruptive messages after certain actions, like successful upload or error."},{"name":"progress","usage":"To visually indicate the progress of file uploads."},{"name":"card","usage":"To present information and controls in a structured, aesthetic manner, adhering to the color scheme and rounded corners."},{"name":"animation","usage":"To enhance the user interface with engaging animations for interactions."},{"name":"skeleton","usage":"To show a loading state before Excel sheet information is displayed."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('whlhk4wkjh7h','zjivmm083mm2','a profile edit form with all user details',replace('\n<script setup lang="ts">\nimport { ref } from ''vue''\nimport { Avatar, AvatarFallback, AvatarImage } from ''@/components/ui/avatar''\nimport { Input } from ''@/components/ui/input''\nimport { Button } from ''@/components/ui/button''\nimport { Textarea } from ''@/components/ui/textarea''\nimport { Checkbox } from ''@/components/ui/checkbox''\nimport { User, Mail, Phone, Lock, Bell } from ''lucide-vue-next''\n</script>\n\n<template>\n  <form class="space-y-8 bg-white dark:bg-black p-8">\n    <!-- Avatar -->\n    <div class="items-center space-y-4 text-center">\n      <Avatar class="inline-block w-24 h-24 ring-4 ring-gray-300 dark:ring-gray-700">\n        <AvatarImage src="https://via.placeholder.com/150" alt="User''s Avatar" />\n        <AvatarFallback>U</AvatarFallback>\n      </Avatar>\n      <Button variant="outline">Change Avatar</Button>\n    </div>\n\n    <!-- Personal Details -->\n    <div class="grid grid-cols-1 gap-6">\n      <div class="space-y-2">\n        <label for="name" class="flex items-center gap-2">\n          <User class="w-5 h-5" />\n          Full Name\n        </label>\n        <Input id="name" type="text" placeholder="John Doe" />\n      </div>\n      <div class="space-y-2">\n        <label for="email" class="flex items-center gap-2">\n          <Mail class="w-5 h-5" />\n          Email Address\n        </label>\n        <Input id="email" type="email" placeholder="john@example.com" />\n      </div>\n      <div class="space-y-2">\n        <label for="phone" class="flex items-center gap-2">\n          <Phone class="w-5 h-5" />\n          Phone Number\n        </label>\n        <Input id="phone" type="tel" placeholder="+123456789" />\n      </div>\n      <div class="space-y-2">\n        <label for="biography" class="flex items-center gap-2">\n          <User class="w-5 h-5" />\n          Biography\n        </label>\n        <Textarea id="biography" placeholder="A bit about yourself..." />\n      </div>\n    </div>\n\n    <!-- Account Settings -->\n    <div class="space-y-4">\n      <div class="space-y-2">\n        <label for="password" class="flex items-center gap-2">\n          <Lock class="w-5 h-5" />\n          Password\n        </label>\n        <Input id="password" type="password" placeholder="••••••••••" />\n      </div>\n      <div class="flex items-start gap-2">\n        <Checkbox id="notifications" />\n        <div class="grid gap-1.5">\n          <label for="notifications" class="flex items-center gap-2">\n            <Bell class="w-5 h-5" />\n            Enable Notifications\n          </label>\n          <p class="text-sm text-gray-600 dark:text-gray-400">Enabling this will send you notifications about your account activity.</p>\n        </div>\n      </div>\n    </div>\n\n    <!-- Actions -->\n    <div class="text-right">\n      <Button type="submit">Save Changes</Button>\n    </div>\n  </form>\n</template>\n','\n',char(10)),1704102378395,'{"description":{"user":"a profile edit form with all user details","llm":"Design a Vue component for a profile edit form that allows users to view and update all their personal details. The form should include fields for the user''s avatar, name, email, phone number, biography, and account settings like password and notification preferences."},"components":[{"name":"avatar","usage":"To display and update the user''s profile picture."},{"name":"input","usage":"For text fields to update name, email, and phone number."},{"name":"textarea","usage":"For a larger text input area to edit the user''s biography."},{"name":"button","usage":"To submit the form after editing the user''s profile details."},{"name":"checkbox","usage":"To toggle notification preferences."},{"name":"popover","usage":"To provide additional information and options for some input fields, such as password requirements."},{"name":"tabs","usage":"To organize the form into different sections, such as ''Personal Info'', ''Account Settings'', etc., for better user experience."},{"name":"alert","usage":"To display any form validation errors or successful update messages."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('q1hluxs3hbqe','o83zru4xzhby','add some image after the description, but before the CTA. Also make the button `default` variant',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle, CardDescription } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex flex-col items-center justify-center h-screen dark:bg-black">\n    <Card class="w-full max-w-sm bg-white shadow-lg rounded-md dark:text-white dark:border dark:border-gray-700">\n      <CardHeader class="border-b border-gray-100 p-4 dark:border-gray-700 ">\n        <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n        <CardDescription class="text-sm mb-6">Thank you for visiting our web app!</CardDescription>\n        <img src="https://placeimg.com/400/200/any" alt="Welcome Image" class="mb-6">\n      </CardHeader>\n      <CardContent class="p-4">\n        <p class="mb-4">We''re excited to have you on board. Browse around and let us know if you have any questions!</p>\n        <Button variant="default" class="w-full flex items-center justify-center">\n          Get Started\n          <ArrowRight class="w-4 h-4 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704102550412,'{"description":{"user":"add some image after the description, but before the CTA. Also make the button `default` variant","llm":"Update the ''simple welcome card'' component to include an image after the description text and before the CTA (Call-to-Action). The button included in the card should have a ''default'' variant style."},"components":[{"name":"card","usage":"To structure the welcome message, image, and button in a visually appealing layout."},{"name":"avatar","usage":"To display the image after the description, allowing for a user or theme-related visual representation."},{"name":"button","usage":"To present a call-to-action for the user, styled as a ''default'' variant."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('zp1xtmnrr8ze','o83zru4xzhby','I want a more simpler card. make the button pop',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex items-center justify-center h-screen bg-gray-50 dark:bg-black">\n    <Card class="w-full max-w-xs mx-auto text-center bg-white dark:text-gray-200 dark:bg-gray-900 shadow-xl rounded-lg">\n      <CardHeader class="p-4">\n        <CardTitle class="text-xl font-semibold">Welcome</CardTitle>\n      </CardHeader>\n      <CardContent class="px-4 py-8">\n        <p class="text-sm mb-6">Explore our web app and get started on your journey!</p>\n        <Button variant="primary" class="relative inline-flex items-center justify-center px-4 py-2 text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 rounded-md shadow-sm">\n          Get Started\n          <ArrowRight class="w-5 h-5 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704102714168,'{"description":{"user":"I want a more simpler card. make the button pop","llm":"The user is requesting to update the ''simple welcome card'' component to have a more simplified design and to make the button stand out. This implies streamlining the card content and styling the button in a way that it catches the user''s attention."},"components":[{"name":"card","usage":"To provide the basic structure of a simple welcome card, using a pre-made card component can save time and ensure consistency in design."},{"name":"button","usage":"To make the button pop, we can use a pre-made button component with vibrant colors and potentially an animation or a shadow that distinguishes it from other elements on the card."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('j4dgo3wpgt5s','mjy8z1pxpo8i','a landing page for animal care website',replace('\n<script setup lang="ts">\nimport { Home, User, Search, Check } from ''lucide-vue-next'';\nimport {\n  Alert,\n  AlertDescription,\n  AlertTitle,\n} from ''@/components/ui/alert'';\nimport { Button } from ''@/components/ui/button'';\nimport {\n  Card,\n  CardContent,\n  CardDescription,\n  CardHeader,\n  CardTitle,\n} from ''@/components/ui/card'';\nimport {\n  NavigationMenu,\n  NavigationMenuContent,\n  NavigationMenuList,\n  NavigationMenuItem,\n  NavigationMenuLink,\n} from ''@/components/ui/navigation-menu'';\nimport { useToast } from ''@/components/ui/toast/use-toast'';\nimport {\n  Tooltip,\n  TooltipContent,\n  TooltipProvider,\n  TooltipTrigger,\n} from ''@/components/ui/tooltip'';\n\nconst { toast } = useToast();\n</script>\n\n<template>\n  <div class="min-h-screen bg-white dark:bg-black">\n    <NavigationMenu as="header" class="py-4 px-8 bg-gray-100 dark:bg-gray-900">\n      <NavigationMenuList class="flex items-center justify-between">\n        <div class="flex items-center space-x-6">\n          <NavigationMenuItem>\n            <Home class="w-6 h-6 text-blue-600" />\n            <NavigationMenuLink class="font-bold text-lg text-gray-900 dark:text-gray-100">Animal Care</NavigationMenuLink>\n          </NavigationMenuItem>\n          <NavigationMenuItem>\n            <NavigationMenuLink class="text-gray-600 dark:text-gray-400 hover:text-gray-900 dark:hover:text-white">Services</NavigationMenuLink>\n          </NavigationMenuItem>\n          <NavigationMenuItem>\n            <NavigationMenuLink class="text-gray-600 dark:text-gray-400 hover:text-gray-900 dark:hover:text-white">About</NavigationMenuLink>\n          </NavigationMenuItem>\n          <NavigationMenuItem>\n            <NavigationMenuLink class="text-gray-600 dark:text-gray-400 hover:text-gray-900 dark:hover:text-white">Contact</NavigationMenuLink>\n          </NavigationMenuItem>\n        </div>\n        <div class="flex items-center space-x-4">\n          <TooltipProvider>\n            <Tooltip>\n              <TooltipTrigger as="div">\n                <Search class="w-6 h-6 text-gray-600 cursor-pointer dark:text-gray-400 hover:text-gray-900 dark:hover:text-white" />\n              </TooltipTrigger>\n              <TooltipContent class="bg-white dark:bg-gray-800 p-2 rounded-md shadow-lg">\n                <p class="text-sm text-gray-900 dark:text-white">Search</p>\n              </TooltipContent>\n            </Tooltip>\n          </TooltipProvider>\n          <Button as="a" href="/login" class="text-sm">Log In</Button>\n          <Button as="a" href="/signup" variant="secondary" class="text-sm">Sign Up</Button>\n        </div>\n      </NavigationMenuList>\n    </NavigationMenu>\n  \n    <main>\n      <section class="text-center py-10 bg-gray-200 dark:bg-gray-800 px-6">\n        <h1 class="text-4xl font-bold text-gray-900 dark:text-white">Welcome to Animal Care</h1>\n        <p class="text-gray-600 dark:text-gray-400 mt-3">Get started with our caring service for your furry friends today!</p>\n        <Button class="mt-6" @click="toast({\n          title: ''Services'',\n          description: ''Check out our various animal care services!''\n        })">Explore Services</Button>\n      </section>\n  \n      <section class="py-10 px-6">\n        <Card>\n          <CardHeader>\n            <CardTitle class="text-lg font-bold text-gray-900 dark:text-white">Why Choose Us?</CardTitle>\n            <CardDescription class="text-gray-600 dark:text-gray-400">We provide top-tier services for your pets.</CardDescription>\n          </CardHeader>\n          <CardContent class="space-y-4">\n            <p class="text-sm text-gray-600 dark:text-gray-400">Our team of professionals is dedicated to offering the best care possible.</p>\n            <Button variant="ghost">Learn More</Button>\n          </CardContent>\n        </Card>\n      </section>\n  \n      <section class="bg-gray-100 dark:bg-gray-900 py-10 px-6">\n        <Alert>\n          <AlertTitle class="font-bold text-lg">Heads Up!</AlertTitle>\n          <AlertDescription class="text-gray-600 dark:text-gray-400">You can fully trust us with your pet''s health and well-being.</AlertDescription>\n        </Alert>\n      </section>\n  \n      <section class="py-10 px-6">\n        <h2 class="text-3xl font-bold text-gray-900 dark:text-white">How It Works</h2>\n        <div class="flex justify-center mt-4 space-x-6">\n          <Check class="w-6 h-6 text-green-500" />\n          <span class="text-gray-600 dark:text-gray-400">Sign up for free and create your profile.</span>\n        </div>\n        <div class="flex justify-center mt-4 space-x-6">\n          <Check class="w-6 h-6 text-green-500" />\n          <span class="text-gray-600 dark:text-gray-400">Choose the services your pet needs.</span>\n        </div>\n        <div class="flex justify-center mt-4 space-x-6">\n          <Check class="w-6 h-6 text-green-500" />\n          <span class="text-gray-600 dark:text-gray-400">Enjoy a happy and healthy pet!</span>\n        </div>\n      </section>\n    </main>\n    \n    <footer class="bg-gray-200 dark:bg-gray-800 py-5 px-8 text-center">\n      <span class="text-sm text-gray-600 dark:text-gray-400">&copy; 2023 Animal Care. All rights reserved.</span>\n    </footer>\n  </div>\n</template>\n','\n',char(10)),1704103283194,'{"description":{"user":"a landing page for animal care website","llm":"Design a Vue component for a landing page of an animal care website. The component should be welcoming and informative, providing users with an overview of the services offered, how to get started, and quick access to important features."},"components":[{"name":"carousel","usage":"to showcase featured animals and services"},{"name":"card","usage":"to display key services and information in an organized manner"},{"name":"button","usage":"to allow users to take actions like signing up or browsing services"},{"name":"navigation-menu","usage":"for easy access to different sections of the website"},{"name":"toast","usage":"to provide notifications or updates in a non-disruptive manner"},{"name":"tooltip","usage":"to offer additional information for certain elements when hovered"},{"name":"alert","usage":"to display important messages or announcements"},{"name":"progress","usage":"to show loading states or progress for actions taken by the user"}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('lrqjizeq8zze','jo16yl16stgg','simple welcome card',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex items-center justify-center h-screen bg-gray-50 dark:bg-black">\n    <Card class="w-full max-w-xs mx-auto text-center bg-white dark:text-gray-200 dark:bg-gray-900 shadow-xl rounded-lg">\n      <CardHeader class="p-4">\n        <CardTitle class="text-xl font-semibold">Welcome</CardTitle>\n      </CardHeader>\n      <CardContent class="px-4 py-8">\n        <p class="text-sm mb-6">Explore our web app and get started on your journey!</p>\n        <Button variant="primary" class="relative inline-flex items-center justify-center px-4 py-2 text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 rounded-md shadow-sm">\n          Get Started\n          <ArrowRight class="w-5 h-5 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704178115442,'{"description":{"user":"I want a more simpler card. make the button pop","llm":"The user is requesting to update the ''simple welcome card'' component to have a more simplified design and to make the button stand out. This implies streamlining the card content and styling the button in a way that it catches the user''s attention."},"components":[{"name":"card","usage":"To provide the basic structure of a simple welcome card, using a pre-made card component can save time and ensure consistency in design."},{"name":"button","usage":"To make the button pop, we can use a pre-made button component with vibrant colors and potentially an animation or a shadow that distinguishes it from other elements on the card."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('sf2uv5uacqba','jo16yl16stgg','I want to have gradient border for the card',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex items-center justify-center min-h-screen bg-gray-50 dark:bg-black p-6">\n    <Card class="w-full max-w-md mx-auto bg-white dark:text-gray-200 dark:bg-gray-900 shadow-lg rounded-lg overflow-hidden border-gradient">\n      <CardHeader class="px-4 py-2">\n        <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n      </CardHeader>\n      <CardContent class="px-4 py-8">\n        <p class="text-sm mb-6">Explore our web app and get started on your journey!</p>\n        <Button variant="primary" class="relative inline-flex items-center justify-center px-4 py-2 text-white bg-blue-600 hover:bg-blue-700 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-blue-500 rounded-md shadow-sm">\n          Get Started\n          <ArrowRight class="w-5 h-5 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n\n<style>\n.border-gradient {\n  border: 2px solid transparent;\n  background-clip: padding-box, border-box;\n  background-origin: padding-box, border-box;\n  background-image: linear-gradient(to right, white, white), linear-gradient(to right, red, orange, yellow, green, blue, indigo, violet);\n}\n</style>\n','\n',char(10)),1704276144832,'{"description":{"user":"I want to have gradient border for the card","llm":"simple welcome card with gradient border"},"components":[{"name":"card","usage":"To provide a structure for the welcome information."},{"name":"aspect-ratio","usage":"To maintain the aspect ratio of the card if it includes media content."}]}',1,NULL,NULL,NULL);
INSERT INTO components VALUES('xsysmm8ye5mt','jo16yl16stgg','Increase fontsize of heading, and change the CTA button to "default" variant',replace('\n<script setup lang="ts">\nimport { Card, CardContent, CardHeader, CardTitle } from ''@/components/ui/card''\nimport { Button } from ''@/components/ui/button''\nimport { ArrowRight } from ''lucide-vue-next''\n</script>\n\n<template>\n  <div class="flex items-center justify-center h-screen bg-gray-50 dark:bg-black">\n    <Card class="w-full max-w-xs mx-auto text-center bg-white dark:text-gray-200 dark:bg-gray-900 shadow-xl rounded-lg">\n      <CardHeader class="p-4">\n        <CardTitle class="text-2xl font-semibold">Welcome</CardTitle>\n      </CardHeader>\n      <CardContent class="px-4 py-8">\n        <p class="text-sm mb-6">Explore our web app and get started on your journey!</p>\n        <Button class="relative inline-flex items-center justify-center px-4 py-2 text-black bg-white hover:bg-gray-100 focus:outline-none focus:ring-2 focus:ring-offset-2 focus:ring-gray-300 rounded-md shadow-sm">\n          Get Started\n          <ArrowRight class="w-5 h-5 ml-2" />\n        </Button>\n      </CardContent>\n    </Card>\n  </div>\n</template>\n','\n',char(10)),1704276478606,'{"description":{"user":"Increase fontsize of heading, and change the CTA button to \"default\" variant","llm":"Update the Simple Welcome Card component to increase the font size of the heading and change the Call To Action (CTA) button to ''default'' variant, which could include a more neutral or standard style compared to any current styling."},"components":[{"name":"button","usage":"To provide the ''default'' variant for the CTA button as requested."},{"name":"card","usage":"To ensure the welcome card structure is maintained and to facilitate the adjustment of the heading font size."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('pdauczaid9qe','qpkxo4n1y4d4','a github button that will open to github link when clicked',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button''\nimport { BrandGithub } from ''lucide-vue-next''\n</script>\n\n<template>\n  <Button\n    as-child\n    @click="window.open(''https://github.com'', ''_blank'')"\n    class="bg-gray-900 text-white hover:bg-gray-800 dark:bg-black dark:hover:bg-gray-900"\n  >\n    <a\n      href="https://github.com"\n      target="_blank"\n      class="flex items-center justify-center px-4 py-2 space-x-2"\n    >\n      <BrandGithub class="w-4 h-4" />\n      <span>GitHub</span>\n    </a>\n  </Button>\n</template>\n','\n',char(10)),1704361902294,'{"description":{"user":"a github button that will open to github link when clicked","llm":"Design a Vue component that looks like a GitHub button. This button, when clicked, should open a specified GitHub link in a new tab or window."},"components":[{"name":"button","usage":"Provides the interactive element for the user to click on."},{"name":"icon","usage":"To display the GitHub logo or iconography within the button."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('h68yabvpgg62','ujiwr7nqai5i','cookie consent form ',replace('\n<script setup lang="ts">\nimport { Dialog, DialogContent, DialogFooter } from ''@/components/ui/dialog'';\nimport { Button } from ''@/components/ui/button'';\nimport { Checkbox } from ''@/components/ui/checkbox'';\nimport { InformationCircle } from ''lucide-vue-next'';\n</script>\n\n<template>\n  <Dialog>\n    <DialogContent\n      class="w-full max-w-lg rounded bg-white dark:bg-black p-6"\n    >\n      <div class="flex flex-col">\n        <div class="flex items-center justify-between mb-2">\n          <h3 class="text-lg font-semibold leading-tight text-gray-900 dark:text-white">Cookie Preferences</h3>\n          <InformationCircle class="w-5 h-5 text-gray-500 dark:text-gray-300" />\n        </div>\n        <p class="text-sm text-gray-600 dark:text-gray-300 mb-6">\n          We use cookies to personalize content and ads, provide social media features, and\n          analyze our traffic. Please select your preferences.\n        </p>\n        <div class="mb-4">\n          <Checkbox id="necessary-cookies" />\n          <label for="necessary-cookies" class="ml-2 text-sm font-medium text-gray-700 dark:text-gray-200">\n            Necessary cookies\n          </label>\n        </div>\n        <div class="mb-4">\n          <Checkbox id="performance-cookies" />\n          <label for="performance-cookies" class="ml-2 text-sm font-medium text-gray-700 dark:text-gray-200">\n            Performance cookies\n          </label>\n        </div>\n        <div class="mb-4">\n          <Checkbox id="targeting-cookies" />\n          <label for="targeting-cookies" class="ml-2 text-sm font-medium text-gray-700 dark:text-gray-200">\n            Targeting cookies\n          </label>\n        </div>\n        <div class="mb-4">\n          <Checkbox id="functionality-cookies" />\n          <label for="functionality-cookies" class="ml-2 text-sm font-medium text-gray-700 dark:text-gray-200">\n            Functionality cookies\n          </label>\n        </div>\n      </div>\n    </DialogContent>\n    <DialogFooter\n      class="flex justify-between bg-gray-50 dark:bg-gray-800 p-4 rounded-b"\n    >\n      <Button variant="destructive">Reject</Button>\n      <Button variant="primary">Accept</Button>\n    </DialogFooter>\n  </Dialog>\n</template>\n','\n',char(10)),1704362016322,'{"description":{"user":"cookie consent form ","llm":"Design a new Vue component that serves as a cookie consent form. The form should inform users about the use of cookies on the website, allow them to accept or reject cookies, and provide options for customizing cookie preferences."},"components":[{"name":"dialog","usage":"To present the cookie consent form as a modal overlay that demands attention from the user before they continue browsing."},{"name":"button","usage":"To provide actionable controls allowing the user to accept all cookies, reject all cookies, or customize their cookie preferences."},{"name":"checkbox","usage":"For customization options where users can individually select which categories of cookies they consent to."},{"name":"card","usage":"To display information about each category of cookies in a clear, card-based layout within the customization options."},{"name":"popover","usage":"To give users more detailed information about cookies when they hover over or focus on certain elements within the form."},{"name":"button","usage":"To provide a submit button for the user to finalize their cookie preferences."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('crm1e0unapvi','qpka5kchj16c',replace('a simple scheduling app\n','\n',char(10)),replace('\n<script setup lang="ts">\nimport { ref } from ''vue''\nimport { Calendar } from ''@/components/ui/calendar''\nimport { Input } from ''@/components/ui/input''\nimport {\n  Table,\n  TableBody,\n  TableCell,\n  TableHead,\n  TableHeader,\n  TableRow,\n} from ''@/components/ui/table''\nimport { Button } from ''@/components/ui/button''\nimport { Trash2, Edit2 } from ''lucide-vue-next''\nimport { useToast } from ''@/components/ui/toast/use-toast''\n\nconst dateSelected = ref(new Date())\nconst eventDetails = ref('''')\nconst { toast } = useToast()\n</script>\n\n<template>\n  <div class="space-y-4 p-4">\n    <Calendar v-model="dateSelected" class="rounded-md border dark:bg-black" />\n    <div class="flex gap-2">\n      <Input v-model="eventDetails" placeholder="Add event details" class="flex-1" />\n      <Button class="bg-blue-500 text-white hover:bg-blue-600 dark:bg-blue-700 dark:text-gray-200 dark:hover:text-white">\n        Save\n      </Button>\n      <Button class="bg-gray-500 text-white hover:bg-gray-600 dark:bg-gray-700 dark:text-gray-200 dark:hover:text-white">\n        Cancel\n      </Button>\n    </div>\n    <Table class="min-w-full divide-y divide-gray-200 shadow-sm dark:divide-gray-700 dark:bg-black">\n      <TableHeader>\n        <TableRow>\n          <TableHead>Date</TableHead>\n          <TableHead>Event Details</TableHead>\n          <TableHead>Actions</TableHead>\n        </TableRow>\n      </TableHeader>\n      <TableBody class="divide-y divide-gray-200 dark:divide-gray-700">\n        <TableRow v-for="index in 3" :key="index">\n          <TableCell class="py-2">2023-01-01</TableCell>\n          <TableCell>Sample Event</TableCell>\n          <TableCell>\n            <div class="flex space-x-2">\n              <Button variant="ghost" class="p-2" @click="() => {\n                toast({ description: ''Editing event...'' });\n              }">\n                <Edit2 class="w-4 h-4 text-gray-600 dark:text-gray-400" />\n              </Button>\n              <Button variant="ghost" class="p-2" @click="() => {\n                toast({ description: ''Deleting event...'', variant: ''destructive'' });\n              }">\n                <Trash2 class="w-4 h-4 text-gray-600 dark:text-gray-400" />\n              </Button>\n            </div>\n          </TableCell>\n        </TableRow>\n      </TableBody>\n    </Table>\n  </div>\n</template>\n','\n',char(10)),1704362844550,'{"description":{"user":"a simple scheduling app\n","llm":"The task is to design a Vue component for a simple scheduling app. The component should feature a calendar for selecting dates, an input field for users to add event details, and buttons to save or cancel the event. It should also include a list or table to display scheduled events, and options to edit or delete them."},"components":[{"name":"calendar","usage":"To allow users to select dates for scheduling their events."},{"name":"input","usage":"For users to enter details of the events they are scheduling."},{"name":"button","usage":"To save or cancel the creation of a new event."},{"name":"table","usage":"To display a list of all scheduled events in an organized manner."},{"name":"dialog","usage":"To confirm the deletion of an event or to display the event details for editing."},{"name":"toast","usage":"To show brief feedback messages upon saving, updating, or deleting events."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('fkff7l4lslmx','ujiwr7nqai5i','I dont want dialog, I want a form that has the settings for cookie preference',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { Checkbox } from ''@/components/ui/checkbox'';\nimport { Label } from ''@/components/ui/label'';\n</script>\n\n<template>\n  <form class="max-w-lg mx-auto my-10 p-6 rounded bg-white dark:bg-black shadow-md">\n    <h2 class="text-xl font-semibold mb-4">Cookie Preferences</h2>\n    <p class="text-sm mb-6">\n      We use cookies to personalize content and ads, provide social media features, and\n      analyze our traffic. Please select your preferences.\n    </p>\n    <div class="flex flex-col space-y-4 mb-6">\n      <div class="flex items-center">\n        <Checkbox id="necessary-cookies" />\n        <Label for="necessary-cookies" class="ml-2 text-sm">Necessary cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Checkbox id="performance-cookies" />\n        <Label for="performance-cookies" class="ml-2 text-sm">Performance cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Checkbox id="targeting-cookies" />\n        <Label for="targeting-cookies" class="ml-2 text-sm">Targeting cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Checkbox id="functionality-cookies" />\n        <Label for="functionality-cookies" class="ml-2 text-sm">Functionality cookies</Label>\n      </div>\n    </div>\n    <div class="flex justify-between">\n      <Button variant="destructive">Reject</Button>\n      <Button variant="primary">Accept</Button>\n    </div>\n  </form>\n</template>\n','\n',char(10)),1704381293615,'{"description":{"user":"I dont want dialog, I want a form that has the settings for cookie preference","llm":"cookie consent form"},"components":[{"name":"card","usage":"To provide a structured look for the form, containing the header, content, and footer sections."},{"name":"checkbox","usage":"To allow users to select or deselect different types of cookies they consent to."},{"name":"button","usage":"To submit the users'' cookie preferences."},{"name":"label","usage":"To provide descriptive labels associated with the cookie preference checkboxes."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('fng8rsegl8sq','ujiwr7nqai5i','Nice! change the variant of "Accept" button to "default". Change "checkbox" into "switch"',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { Switch } from ''@/components/ui/switch'';\nimport { Label } from ''@/components/ui/label'';\n</script>\n\n<template>\n  <form class="max-w-lg mx-auto my-10 p-6 rounded bg-white dark:bg-black shadow-md">\n    <h2 class="text-xl font-semibold mb-4">Cookie Preferences</h2>\n    <p class="text-sm mb-6">\n      We use cookies to personalize content and ads, provide social media features, and\n      analyze our traffic. Please select your preferences.\n    </p>\n    <div class="flex flex-col space-y-4 mb-6">\n      <div class="flex items-center">\n        <Switch id="necessary-cookies"/>\n        <Label for="necessary-cookies" class="ml-2 text-sm">Necessary cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Switch id="performance-cookies"/>\n        <Label for="performance-cookies" class="ml-2 text-sm">Performance cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Switch id="targeting-cookies"/>\n        <Label for="targeting-cookies" class="ml-2 text-sm">Targeting cookies</Label>\n      </div>\n      <div class="flex items-center">\n        <Switch id="functionality-cookies"/>\n        <Label for="functionality-cookies" class="ml-2 text-sm">Functionality cookies</Label>\n      </div>\n    </div>\n    <div class="flex justify-between">\n      <Button variant="destructive">Reject</Button>\n      <Button>Accept</Button>\n    </div>\n  </form>\n</template>\n','\n',char(10)),1704381584670,'{"description":{"user":"Nice! change the variant of \"Accept\" button to \"default\". Change \"checkbox\" into \"switch\"","llm":"A form component that allows users to manage their cookie preferences with an ''Accept'' button set to the default variant and toggle switches instead of checkboxes."},"components":[{"name":"form","usage":"To structure the settings for cookie preferences."},{"name":"switch","usage":"To change the checkbox into a switch for a more intuitive toggle action."},{"name":"button","usage":"To change the ''Accept'' button variant to ''default''."},{"name":"card","usage":"To group and display the cookie settings elegantly."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('o6upjfooqhqo','v3vak07ym6p2','a simple instagram post',replace('\n<script setup lang="ts">\nimport { Heart, MessageCircle, ArrowUpRight } from ''lucide-vue-next'';\nimport { Avatar, AvatarImage, AvatarFallback } from ''@/components/ui/avatar'';\n</script>\n\n<template>\n  <div class="max-w-sm overflow-hidden rounded-lg shadow-lg dark:bg-black">\n    <div class="flex items-center p-3">\n      <Avatar>\n        <AvatarImage src="https://github.com/radix-vue.png" alt="User''s Avatar" />\n        <AvatarFallback>U</AvatarFallback>\n      </Avatar>\n      <div class="ml-3">\n        <p class="text-sm font-semibold text-gray-700 dark:text-gray-300">Username</p>\n        <p class="text-xs text-gray-500 dark:text-gray-400">@userhandle</p>\n      </div>\n    </div>\n    <img class="w-full" src="/placeholder.svg" alt="Instagram Post Image">\n    <div class="p-4">\n      <div class="flex space-x-4 font-semibold">\n        <button type="button" class="outline-none focus:outline-none">\n          <Heart class="w-6 h-6 text-gray-600 hover:text-red-500 dark:text-gray-300" />\n        </button>\n        <button type="button" class="outline-none focus:outline-none">\n          <MessageCircle class="w-6 h-6 text-gray-600 hover:text-blue-500 dark:text-gray-300" />\n        </button>\n        <button type="button" class="ml-auto outline-none focus:outline-none">\n          <ArrowUpRight class="w-6 h-6 text-gray-600 hover:text-green-500 dark:text-gray-300" />\n        </button>\n      </div>\n      <p class="mt-2 text-sm text-gray-700 dark:text-gray-300">1,024 likes</p>\n      <p class="mt-1 text-sm text-gray-700 dark:text-gray-300">\n        <span class="font-semibold">Username </span>\n        Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime, voluptates.\n      </p>\n      <div class="mt-2">\n        <p class="text-xs text-gray-400 dark:text-gray-500">View all 14 comments</p>\n        <div class="mt-1">\n          <p class="text-sm text-gray-700 dark:text-gray-300">\n            <span class="font-semibold">Commenter Name </span>\n            This is a comment on the post!\n          </p>\n          <!-- Add more comment placeholders as needed -->\n        </div>\n      </div>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704422698396,'{"description":{"user":"a simple instagram post","llm":"A Vue component that resembles an Instagram post. This component will display the user''s avatar, their name, the image they have posted, any caption that goes with the image, as well as icons for liking, commenting, and sharing the post. Additionally, the component should show the number of likes and a section to display comments."},"components":[{"name":"avatar","usage":"To display the user''s profile picture."},{"name":"card","usage":"To encapsulate the post elements such as image, caption, and interactions."},{"name":"button","usage":"To create interaction buttons for liking, commenting, and sharing the post."},{"name":"toast","usage":"To show ephemeral feedback messages after the user interacts with the post (e.g., likes a post)."},{"name":"input","usage":"To give the user a place to submit new comments."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('lyv7v26tpese','v3vak07ym6p2',replace('center the component inside a div, and make it expand the comment section when clicking on "view all 14 comments"\n','\n',char(10)),replace('\n<script setup lang="ts">\nimport { ref } from ''vue'';\nimport { Heart, MessageCircle, ArrowUpRight } from ''lucide-vue-next'';\nimport { Avatar, AvatarImage, AvatarFallback } from ''@/components/ui/avatar'';\nimport { Collapsible, CollapsibleContent, CollapsibleTrigger } from ''@/components/ui/collapsible'';\n\nconst isOpen = ref(false);\n</script>\n\n<template>\n  <div class="flex justify-center">\n    <div class="max-w-sm w-full overflow-hidden rounded-lg shadow-lg dark:bg-black">\n      <div class="flex items-center p-3">\n        <Avatar>\n          <AvatarImage src="https://github.com/radix-vue.png" alt="User''s Avatar" />\n          <AvatarFallback>U</AvatarFallback>\n        </Avatar>\n        <div class="ml-3">\n          <p class="text-sm font-semibold text-gray-700 dark:text-gray-300">Username</p>\n          <p class="text-xs text-gray-500 dark:text-gray-400">@userhandle</p>\n        </div>\n      </div>\n      <img class="w-full" src="/placeholder.svg" alt="Instagram Post Image">\n      <div class="p-4">\n        <div class="flex space-x-4 font-semibold">\n          <button type="button" class="outline-none focus:outline-none">\n            <Heart class="w-6 h-6 text-gray-600 hover:text-red-500 dark:text-gray-300" />\n          </button>\n          <button type="button" class="outline-none focus:outline-none">\n            <MessageCircle class="w-6 h-6 text-gray-600 hover:text-blue-500 dark:text-gray-300" />\n          </button>\n          <button type="button" class="ml-auto outline-none focus:outline-none">\n            <ArrowUpRight class="w-6 h-6 text-gray-600 hover:text-green-500 dark:text-gray-300" />\n          </button>\n        </div>\n        <p class="mt-2 text-sm text-gray-700 dark:text-gray-300">1,024 likes</p>\n        <p class="mt-1 text-sm text-gray-700 dark:text-gray-300">\n          <span class="font-semibold">Username </span>\n          Lorem ipsum dolor sit amet consectetur adipisicing elit. Maxime, voluptates.\n        </p>\n        \n        <Collapsible v-model:open="isOpen" class="mt-2">\n          <p class="text-xs text-gray-400 dark:text-gray-500 cursor-pointer" @click="isOpen = !isOpen">\n            View all 14 comments\n          </p>\n          <CollapsibleContent class="space-y-1 mt-1">\n            <p class="text-sm text-gray-700 dark:text-gray-300">\n              <span class="font-semibold">Commenter Name </span>\n              This is a comment on the post!\n            </p>\n            <!-- Add more comment placeholders -->\n          </CollapsibleContent>\n        </Collapsible>\n\n      </div>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704423169945,'{"description":{"user":"center the component inside a div, and make it expand the comment section when clicking on \"view all 14 comments\"\n","llm":"Update the Vue component ''InstagramPost'' to center it within its parent div. Also, incorporate a function that allows expanding the comment section when the text ''view all 14 comments'' is clicked. Ensure that the comment section is initially in a collapsed state and expands to show all comments upon interaction."},"components":[{"name":"collapsible","usage":"To provide an expandable/collapsible comment section within the Instagram post."},{"name":"button","usage":"To create an interactive element that the user can click to expand the comment section."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('n3l9srj91lq4','qpkxo4n1y4d4',replace('change the icon to "GitHub" from "lucide-vue-next", and make 5 other variant of this button\n','\n',char(10)),replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { GitHub } from ''lucide-vue-next'';\n</script>\n\n<template>\n  <!-- Default -->\n  <Button \n    class="bg-gray-900 text-white hover:bg-gray-800 dark:bg-black dark:hover:bg-gray-900" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n\n  <!-- Outline -->\n  <Button \n    variant="outline" \n    class="border border-gray-900 text-gray-900 hover:bg-gray-100 dark:border-white dark:text-white dark:hover:bg-gray-800" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n\n  <!-- Solid -->\n  <Button \n    class="bg-blue-500 text-white hover:bg-blue-600 dark:bg-blue-600 dark:hover:bg-blue-700" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n\n  <!-- Ghost -->\n  <Button \n    variant="ghost" \n    class="text-gray-900 hover:bg-gray-200 dark:text-white dark:hover:bg-gray-700" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n\n  <!-- Destructive -->\n  <Button \n    variant="destructive" \n    class="bg-red-500 text-white hover:bg-red-600 dark:bg-red-600 dark:hover:bg-red-700" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n\n  <!-- Secondary -->\n  <Button \n    variant="secondary" \n    class="bg-gray-200 text-gray-900 hover:bg-gray-300 dark:bg-gray-700 dark:text-white dark:hover:bg-gray-600" \n    @click="window.open(''https://github.com'', ''_blank'')">\n    <GitHub class="w-4 h-4 mr-2"/>\n    GitHub\n  </Button>\n</template>\n','\n',char(10)),1704423504714,'{"description":{"user":"change the icon to \"GitHub\" from \"lucide-vue-next\", and make 5 other variant of this button\n","llm":"Design a Vue component which is a button that, when clicked, opens a link to GitHub. The button should feature a ''GitHub'' icon from the ''lucide-vue-next'' icon library and have five variant styles."},"components":[{"name":"button","usage":"The primary component of the design is a clickable button element."},{"name":"icon","usage":"To incorporate the ''GitHub'' icon from the ''lucide-vue-next'' library into the button."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('fog8upjtr6yu','wn89oo6bhd2b','add gitlab oauth too',replace('\n<script setup lang="ts">\nimport { Button } from ''@/components/ui/button'';\nimport { Input } from ''@/components/ui/input'';\nimport { Github, Gitlab } from ''lucide-vue-next'';\n</script>\n\n<template>\n  <div class="w-full min-h-screen flex items-center justify-center p-4 bg-gray-50 dark:bg-black">\n    <div class="w-full max-w-md rounded-lg shadow-md bg-white p-8 dark:bg-gray-900 space-y-6">\n      <h1 class="text-2xl font-bold text-center text-gray-900 dark:text-white">\n        Sign in to your account\n      </h1>\n      <div class="space-y-4">\n        <Input type="email" placeholder="Email address" class="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 dark:bg-gray-800 dark:border-gray-700 dark:text-white" />\n        <Input type="password" placeholder="Password" class="w-full px-4 py-2 border rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500 dark:bg-gray-800 dark:border-gray-700 dark:text-white" />\n      </div>\n      <Button class="w-full bg-blue-500 text-white py-2 px-4 rounded-md hover:bg-blue-600 focus:outline-none focus:ring-2 focus:ring-blue-500 dark:hover:bg-blue-700">\n        Sign in\n      </Button>\n      <div class="flex items-center justify-between">\n        <hr class="w-full bg-gray-300 dark:bg-gray-700" />\n        <span class="p-2 text-gray-500 dark:text-gray-400">\n          or\n        </span>\n        <hr class="w-full bg-gray-300 dark:bg-gray-700"/>\n      </div>\n      <Button class="w-full bg-gray-800 text-white py-2 px-4 rounded-md hover:bg-gray-900 flex items-center justify-center focus:outline-none focus:ring-2 focus:ring-gray-800 dark:hover:bg-gray-700">\n        <Github class="h-5 w-5 mr-3" />\n        Sign in with GitHub\n      </Button>\n      <Button class="w-full bg-indigo-500 text-white py-2 px-4 rounded-md mt-4 hover:bg-indigo-600 flex items-center justify-center focus:outline-none focus:ring-2 focus:ring-indigo-500 dark:hover:bg-indigo-700">\n        <Gitlab class="h-5 w-5 mr-3" />\n        Sign in with GitLab\n      </Button>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704423610404,'{"description":{"user":"add gitlab oauth too","llm":"The Vue component should resemble the appearance and functionality of a default ''Clerk'' SignIn component. The component should now be updated to include GitLab OAuth as an additional authentication option for users to sign in."},"components":[{"name":"button","usage":"To provide a GitLab OAuth button that users can click to initiate the sign in process with GitLab."},{"name":"card","usage":"To create a structured and visually appealing sign-in area that can encapsulate the GitLab OAuth button."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('nrpg0wc1gfll','lpxnzg9gzcxs','cute pulsing ping on top right corner of avatar',replace('\n<script setup lang="ts">\nimport { Avatar, AvatarFallback, AvatarImage } from ''@/components/ui/avatar''\n</script>\n\n<template>\n  <div class="relative inline-block">\n    <Avatar>\n      <AvatarImage src="/placeholder.svg" alt="User avatar" />\n      <AvatarFallback>U</AvatarFallback>\n    </Avatar>\n    <div class="absolute top-0 right-0 transform translate-x-1/2 -translate-y-1/2">\n      <div class="animate-ping w-2 h-2 bg-blue-500 rounded-full"></div>\n      <div class="w-2 h-2 bg-blue-500 rounded-full"></div>\n    </div>\n  </div>\n</template>\n','\n',char(10)),1704623230684,'{"description":{"user":"cute pulsing ping on top right corner of avatar","llm":"Design a Vue component that adds a pulsing ping effect on the top right corner of an avatar to signify an active status or a notification."},"components":[{"name":"avatar","usage":"To display the user or entity image which will get the pulsing ping effect."},{"name":"badge","usage":"To represent the pulsing ping as a badge placed over the avatar."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('lzl666osmkno','gagojjt9ylug',' a simple card',replace('\n<script setup lang="ts">\nimport { Mail, ChevronRight } from ''lucide-vue-next'';\nimport {\n  Card,\n  CardContent,\n  CardFooter,\n  CardHeader,\n  CardTitle,\n} from ''@/components/ui/card'';\nimport { Button } from ''@/components/ui/button'';\n</script>\n\n<template>\n  <Card class="max-w-sm bg-white shadow-lg dark:bg-black">\n    <CardHeader>\n      <CardTitle class="text-lg font-bold dark:text-white">\n        Card Title\n      </CardTitle>\n    </CardHeader>\n    <CardContent class="space-y-4 dark:text-gray-300">\n      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque ut quam vel lorem sagittis vehicula.</p>\n      <img src="/placeholder.svg" alt="Placeholder" class="w-full h-auto">\n    </CardContent>\n    <CardFooter class="flex justify-between items-center dark:border-t dark:border-gray-700">\n      <Button class="bg-blue-500 text-white rounded-lg hover:bg-blue-600 dark:bg-blue-600 dark:hover:bg-blue-700">\n        <Mail class="mr-2 h-4 w-4" /> Contact us\n      </Button>\n      <Button variant="ghost" class="text-blue-500 hover:text-blue-600 dark:text-blue-400 dark:hover:text-blue-500">\n        Learn more\n        <ChevronRight class="ml-2 h-4 w-4" />\n      </Button>\n    </CardFooter>\n  </Card>\n</template>\n','\n',char(10)),1705542348188,'{"description":{"user":" a simple card","llm":"Design a simple card component for a Vue web app that displays content in a visually appealing container. The card should have a header, a content area, and an optional footer. It should support text, images, and basic interaction such as clickable buttons, if necessary."},"components":[{"name":"card","usage":"Provides a pre-styled container that serves as the fundamental structure for the simple card."},{"name":"button","usage":"Allows the integration of interactive elements within the card for user interaction."},{"name":"avatar","usage":"Can be used for representing a user or an entity in the card header."}]}',1,59365435,NULL,NULL);
INSERT INTO components VALUES('v8kbp5es2sxy','gagojjt9ylug','remove the image, make button default variant',replace('\n<script setup lang="ts">\nimport { ChevronRight } from ''lucide-vue-next'';\nimport {\n  Card,\n  CardContent,\n  CardFooter,\n  CardHeader,\n  CardTitle,\n} from ''@/components/ui/card'';\nimport { Button } from ''@/components/ui/button'';\n</script>\n\n<template>\n  <Card class="max-w-sm bg-white shadow-lg dark:bg-black">\n    <CardHeader>\n      <CardTitle class="text-lg font-bold dark:text-white">\n        Card Title\n      </CardTitle>\n    </CardHeader>\n    <CardContent class="space-y-4 dark:text-gray-300">\n      <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Pellentesque ut quam vel lorem sagittis vehicula.</p>\n    </CardContent>\n    <CardFooter class="flex justify-between items-center dark:border-t dark:border-gray-700">\n      <Button variant="default" class="bg-blue-500 text-white rounded-lg hover:bg-blue-600 dark:bg-blue-600 dark:hover:bg-blue-700">\n        Contact us\n      </Button>\n      <Button variant="ghost" class="text-blue-500 hover:text-blue-600 dark:text-blue-400 dark:hover:text-blue-500">\n        Learn more\n        <ChevronRight class="ml-2 h-4 w-4" />\n      </Button>\n    </CardFooter>\n  </Card>\n</template>\n','\n',char(10)),1705549691640,'{"description":{"user":"remove the image, make button default variant","llm":"a simple card with removed image and a default variant button"},"components":[{"name":"card","usage":"To layout the primary structure of the simple card."},{"name":"button","usage":"To provide an interactive element with a default variant."}]}',1,59365435,NULL,'lzl666osmkno');
